import React from 'react';

const ResultsList = ({ results }) => (
  <div className="mt-4">
    {results.map((law) => (
      <div key={law.id} className="border p-4 rounded mb-2 shadow">
        <h2 className="text-xl font-bold">{law.title}</h2>
        <p className="text-gray-700 mb-2">{law.description}</p>
        <a href={law.url} target="_blank" rel="noopener noreferrer" className="text-blue-600 underline">
          View Law
        </a>
        <div className="mt-2">
          <button
            onClick={() => navigator.clipboard.writeText(law.citation)}
            className="text-sm bg-gray-200 px-2 py-1 rounded hover:bg-gray-300"
          >
            Copy MLA Citation
          </button>
        </div>
      </div>
    ))}
  </div>
);

export default ResultsList;
